window.addEventListener(
	'load',
	function () {
		const BLACK_ICON_BASE64 =
			'data:image/png;base64,';

		const WHITE_ICON_BASE64 =
			'data:image/png;base64,';

		const interval = setInterval(() => {
			var xIcon = document.querySelector(
				'#react-root > div > div > div.css-1dbjc4n.r-18u37iz.r-13qz1uu.r-417010 > header > div > div > div > div.css-1dbjc4n.r-1habvwh > div.css-1dbjc4n.r-dnmrzs.r-1vvnge1 > h1 > a > div'
			);

			// get background color
			var backgroundColor =
				document.querySelector('body').style.backgroundColor;

			if (xIcon) {
				// remove the X icon and change with our image
				xIcon.removeChild(xIcon.childNodes[0]);
				// if bg color is white set black icon
				if (backgroundColor === 'rgb(255, 255, 255)') {
					xIcon.style.backgroundImage = `url(${BLACK_ICON_BASE64})`;
				} else {
					xIcon.style.backgroundImage = `url(${WHITE_ICON_BASE64})`;
				}
				xIcon.style.backgroundSize = 'contain';
				xIcon.style.backgroundRepeat = 'no-repeat';
				xIcon.style.backgroundPosition = 'center';
				xIcon.style.width = '30px';
				xIcon.style.marginLeft = '10px';
				clearInterval(interval);
			} else {
				console.log('Fuck Dogecoin: Original icon not found!');
			}
		}, 0);
	},
	false
);
